import StyledButton from './styledComponents/StyledButton.js'
import { Box, Card, Container, Grid, makeStyles } from '@material-ui/core'
import Typography from '@material-ui/core/Typography'
import PersonalCalendar from './styledComponents/PersonalCalendar'
import EmployeesView from './EmployeesPage.js'

const homeStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
        flexDirection: 'column',
        alignItems:'center',
        justifyContent:'center',
    },
    title: {
        margin:'1rem',
    },
    homeDisplay: {
        display: 'flex',
        flexDirecton: 'row',
        alignItems: 'center',
        justifyContent: 'center',
    },
    calendarCard: {
        height:'75vh',
        borderRadius: '10px',
        width: '60vw'
    }
}))

const Home = ({employee}) => {
    const classes = homeStyles()
    return (
        <Container className={classes.root} >
            <Typography variant='h4' className={classes.title}>Home Page</Typography>
            <Container className={classes.homeDisplay} >
                {employee.firstName}
                <Card className={classes.calendarCard}>
                    <PersonalCalendar shifts={employee.weekSchedule}/>
                </Card>
            </Container>
        </Container>
    )
}

export default Home
